import React, {useEffect, useState} from 'react';
import './App.css';
import BasicTextFields from './InputBox'
import ButtonAppBar from "./appbar";
import Box from "@material-ui/core/Box";
import { makeStyles, createStyles } from '@material-ui/core/styles';
import Button from "@material-ui/core/Button";
import RadioButtonsGroup from "./radiobuttons";

const useStyles = makeStyles((theme) => createStyles({
  root: {
    // backgroundColor: "#ff1133",
      border:"2px solid blue",
      backgroundImage:"back.png",
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'center',
      marginLeft:"25%",
      marginTop:"5%",
      marginBottom:"5%",
      marginRight:"25%",
      borderRadius:20,
      padding: 40,
  },
}));






function App() {
    const classes = useStyles();

    const [data, setData] = useState([]);
    //const [syms, putData] = useState([]);
    //const [sol, solution] = useState("");

    async function getcolnames() {
        const response = await fetch('http://127.0.0.1:8000/symptoms/',
            {

                method: "GET",
                headers: {
                    'Content-Type': 'application/json'
                },
            });
        const json = await response.json();
        setData(json['symptoms']);
        console.log(json['symptoms'])
    }

    useEffect(() => {
        // GET request using fetch inside useEffect React hook
        getcolnames()
    }, []);

    const [key, setKey] = useState(
      {
        "age" : "",
          "gender" : ""
      }
  );

    const setValue = ( key,value) => {
    const newData = data;
    setKey[key] = value;
    setKey(newData)

  };
    console.log(key);

    return (
        <div className="App">
            <div>
                <ButtonAppBar/>
            </div>
                <Box display="flex" className={classes.root} flexWrap="wrap">
                    <RadioButtonsGroup/>
                    <BasicTextFields label={data[0]} onChange={((e)=> setValue(key, e.state.value))}/>
                    <BasicTextFields label={data[1]} onChange={((e)=> setValue(key, e.state.value))}/>


                    <Button variant="contained" color="primary">SUBMIT</Button>
                </Box>

        </div>
    );
}

export default App;
